import LegendItem from "./LegendItem";

const legendItems = [
  new LegendItem("More than 2 mentions", "#d17c00", (cases) => cases > 6),
  new LegendItem("2 mentions", "#ef9400", (cases) => cases === 6),
  new LegendItem("2 mentions", "#ef9400", (cases) => cases === 5),
  new LegendItem("2 mentions", "#ef9400", (cases) => cases === 4),
  new LegendItem("2 mentions", "#ef9400", (cases) => cases === 3),
  new LegendItem("2 mentions", "#ef9400", (cases) => cases === 2),
  new LegendItem("1 mention", "#feb423", (cases) => cases === 1),
  new LegendItem("No mentions", "#ffda51", (cases) => cases === 0), // "#ffda51"
  // new LegendItem("No data", "#ffffff", (cases) => true),
];

export default legendItems;
